import React from 'react';

// Sample data for Reminders and Notifications
const reminders = [
  "Medicine",
  "Doctor appointment",
  "Bedtime",
  "Exercise",
  "Medication",
  "Meals",
  "Drink water",
  "Monthly payments",
];

const notifications = [
  "Medicine",
  "Drink water",
  "Pension status update",
  "Bank visit",
  "Bill payments",
  "Eye check-up",
  "Booking confirmation",
];

const App = () => {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <img src="4966443.jpg" alt="Reminders" style={styles.icon} />
        <h1 style={styles.title}>Reminders & Notifications</h1>
      </header>

      <section style={styles.remindersSection}>
        <h2 style={styles.subTitle}>
          <span style={styles.reminderIcon}>âŒš</span> Reminders
        </h2>
        <ul style={styles.list}>
          {reminders.map((item, index) => (
            <li key={index} style={styles.listItem}>
              {item}
              <span style={styles.itemIcon}>ðŸ””</span>
            </li>
          ))}
        </ul>
      </section>

      <section style={styles.notificationsSection}>
        <h2 style={styles.subTitle}>
          <span style={styles.notificationIcon}>ðŸ””</span> Notifications
        </h2>
        <ul style={styles.list}>
          {notifications.map((item, index) => (
            <li key={index} style={styles.listItem}>
              {item}
              <input type="checkbox" style={styles.checkbox} />
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  header: {
    display: 'flex',
    alignItems: 'center',
  },
  icon: {
    width: '50px',
    height: '50px',
    marginRight: '10px',
  },
  title: {
    fontSize: '36px',
    fontWeight: 'bold',
  },
  remindersSection: {
    marginTop: '30px',
  },
  notificationsSection: {
    marginTop: '30px',
  },
  subTitle: {
    fontSize: '24px',
    marginBottom: '10px',
  },
  reminderIcon: {
    marginRight: '8px',
  },
  notificationIcon: {
    marginRight: '8px',
  },
  list: {
    listStyle: 'none',
    paddingLeft: '0',
  },
  listItem: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 0',
    borderBottom: '1px solid #ccc',
  },
  itemIcon: {
    marginLeft: '10px',
  },
  checkbox: {
    cursor: 'pointer',
  },
};

export default App;
